// src/assets/routes/AppRoutes.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PublicLayout from '../components/Layouts/PublicLayout';
import HomePage from '../pages/HomePage';
import LoginPage from '../pages/Auth/LoginPage';
import RegisterPage from '../pages/Auth/RegisterPage';
import PrivateRoute from './PrivateRoute'; // Import PrivateRoute

const AppRoutes = () => {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <PublicLayout>
              <HomePage />
            </PublicLayout>
          }
        />
        <Route
          path="/signin"
          element={
            <PublicLayout>
              <LoginPage />
            </PublicLayout>
          }
        />
        <Route
          path="/signup"
          element={
            <PublicLayout>
              <RegisterPage />
            </PublicLayout>
          }
        />
        <PrivateRoute
          path="/protected" // Example protected route
          element={
            <PublicLayout>
              <SomeProtectedPage />
            </PublicLayout>
          }
        />
        <Route path="/signout" />
      </Routes>
    </Router>
  );
};

export default AppRoutes;
